import React from 'react'
import { FaTimes,FaGlobe } from 'react-icons/fa'
// import { default as NumberFormat } from 'react-number-format';

const County = ({ county, onDelete, onToggle }) => {
  return (
<tr>
          <td>{county.county_code}</td>
          <td>{county.county_name}</td>
          <td>
            <FaGlobe
          style={{ color: 'blue', cursor: 'pointer' }}
          onClick={() => onDelete(county.id)}
        />  </td>
          <td>


          <button style={{ color: 'red', cursor: 'pointer' }}
           className="btn btn-danger" onClick={() => {if(window.confirm('Delete the item?')){
            onDelete(county.id)
            };}}>

    <FaTimes  style={{ color: 'white', cursor: 'pointer' }}></FaTimes>


                Delete</button>


</td>
        </tr>
  )
}
export default County
